/* eslint-disable import/prefer-default-export */
import styled from 'styled-components';

export const Input = styled.input`
    max-height: 32px;
    min-height: 32px;
    width: 600px;
    border:1px solid aqua;
    border-radius:5px;
    padding: 0 7px;
    border: 1px solid #c2c2c2;

    }
`;
